import { Navbar, Nav, Image } from 'react-bootstrap';

const Header = () => {
  <Navbar fixed="top" collapseOnSelect expand="lg" bg="dark" variant="dark">
    <Navbar.Brand>
      <Image src="../../assets/images/logo.png" />
    </Navbar.Brand>
  </Navbar>
}

export default Header;
